curr.execute('DROP TABLE IF EXISTS address')
curr.execute('CREATE TABLE Address (idAddress MEDIUMINT NOT NULL AUTO_INCREMENT, Location VARCHAR(225), PRIMARY KEY(idAddress))')
curr.execute('INSERT INTO address (Location) SELECT DISTINCT location FROM times_data')
curr.execute('DROP TABLE IF EXISTS restaurant')
curr.execute('CREATE TABLE restaurant (idRestaurant MEDIUMINT NOT NULL AUTO_INCREMENT, CompanyName varchar(225) DEFAULT NULL, PRIMARY KEY (idRestaurant))')   
curr.execute('INSERT INTO restaurant (CompanyName) SELECT companyname FROM times_data')
curr.execute('DROP TABLE IF EXISTS sub_subindustry')
curr.execute('CREATE TABLE sub_subindustry (idSub_subindustry MEDIUMINT NOT NULL AUTO_INCREMENT, Sub_subindustry varchar(225) DEFAULT NULL, PRIMARY KEY (idSub_subindustry))')
curr.execute('INSERT INTO sub_subindustry (Sub_subindustry) SELECT DISTINCT Sub_subindustry FROM times_data')
curr.execute('DROP TABLE IF EXISTS subindustry')
curr.execute('CREATE TABLE subindustry (idSubindustry MEDIUMINT NOT NULL AUTO_INCREMENT, Subindustry varchar(225) DEFAULT NULL, PRIMARY KEY (idSubindustry))')           
curr.execute('INSERT INTO subindustry (Subindustry) SELECT DISTINCT Subindustry FROM times_data')

curr.execute('DROP TABLE IF EXISTS Intermediate_Rest_SubInd')
curr.execute('CREATE TABLE Intermediate_Rest_SubInd AS (SELECT idRestaurant, SubindustryID FROM (SELECT si.idSubindustry AS SubindustryID, td.companyname AS CompanyName FROM subindustry AS si INNER JOIN times_data AS td ON si.Subindustry=td.Subindustry) AS x INNER JOIN restaurant as r ON x.CompanyName=r.CompanyName)')
curr.execute('DROP TABLE IF EXISTS Intermediate_Rest_Subsub')
curr.execute('CREATE TABLE Intermediate_Rest_Subsub AS (SELECT idRestaurant, SubSubindustry FROM (SELECT ssi.idSub_subindustry AS SubSubindustry, td.companyname AS CompanyName FROM sub_subindustry AS ssi INNER JOIN times_data as td ON ssi.Sub_Subindustry=td.sub_subindustry) AS x INNER JOIN restaurant as r ON x.CompanyName=r.CompanyName)')

curr.execute('DROP TABLE IF EXISTS Intermediate_Rest_Location')
curr.execute('CREATE TABLE Intermediate_Rest_Location AS (SELECT idRestaurant, idAddress FROM (SELECT a.idAddress AS idAddress, td.companyname AS CompanyName FROM address AS a INNER JOIN times_data AS td ON a.Location=td.location) AS x INNER JOIN restaurant as r ON x.CompanyName=r.CompanyName)')

